  function initializeTerrain(args, proxyUrl) {
    // Dropdown to provide optional baselayer map
    var terrainProvider;
    // Loop through args.configProperties for layerType to populate dropdown
    var strData;
    var jsonData = undefined;
    if (typeof args.configProperties.data === 'string') {
      strData = args.configProperties.data.replace(/'/g, '"');
      jsonData = JSON.parse(strData);
    } else if (typeof args.configProperties.data === 'object') {
      jsonData = args.configProperties.data;
    } else {
      jsonData = [];
    }
    // Loop through args.configProperties for layerType to populate dropdown
    for (var index = 0; index < jsonData.length; index++) {
      var imageryJsonObject = jsonData[index];
      if (imageryJsonObject.disable.toLowerCase() === "true") {
        continue;
      }
      if (imageryJsonObject.type.toLowerCase() === 'terrain') {
        //terrain layer is enabled so continue
        if (imageryJsonObject.options.toLowerCase() === 'cesium-provider') {
          terrainProvider = new empCesium.CesiumTerrainProvider({
            url: imageryJsonObject.url
          });
        } else if (imageryJsonObject.options.toLowerCase() === 'tigr-provider') {
          terrainProvider = new TigrTerrainProvider({
            url: imageryJsonObject.url,
            proxy: (imageryJsonObject.disableProxy === false)?new empCesium.DefaultProxy(proxyUrl):undefined
          });
        } else if (imageryJsonObject.options.indexOf('geoserver-terrain-provider') > -1) {
          var options = imageryJsonObject.options.split(",");
          if (options.length > 1) {
            var layerName = options[1];
            terrainProvider = new empCesium.GeoserverTerrainProvider({
              url: imageryJsonObject.url,
              layerName: layerName,
              proxy: (imageryJsonObject.disableProxy === false)?new empCesium.DefaultProxy(proxyUrl):undefined
            });
          }
        } else if (imageryJsonObject.options.indexOf('wcs-terrain-provider') > -1) {
          var options = imageryJsonObject.options.split(",");
          if (options.length > 1) {
            var layerName = options[1];
            terrainProvider = new empCesium.WCSTerrainProvider({
              service: "WCS",
              url: imageryJsonObject.url,
              layerName: layerName,
              proxy: (imageryJsonObject.disableProxy === false)?new empCesium.DefaultProxy(proxyUrl):undefined
            });
          }
        } else if (imageryJsonObject.options.toLowerCase() === 'arcgis-terrain-provider') {
          terrainProvider = new empCesium.ArcGisImageServerTerrainProvider({
            url: imageryJsonObject.url,
            proxy: (imageryJsonObject.disableProxy === false)?new empCesium.DefaultProxy(proxyUrl):undefined
          });
        } else if (imageryJsonObject.options.indexOf('arcgis-bil-terrain-provider') > -1) {
          var options = imageryJsonObject.options.split(",");
          if (options.length > 1) {
            var layerName = options[1];
            terrainProvider = new empCesium.ArcgisBilTerrainProvider({
              url: imageryJsonObject.url,
              layerName: layerName,
              proxy: (imageryJsonObject.disableProxy === false)?new empCesium.DefaultProxy(proxyUrl):undefined
            });
          }
        }
      }
    }
    if (terrainProvider) {
      empCesium.scene.terrainProvider = terrainProvider;
      empCesium.terrainRemoveCallback = terrainProvider.errorEvent.addEventListener(function(err) {
        empCesium.terrainProvider = new empCesium.EllipsoidTerrainProvider({
          tilingScheme: new empCesium.GeographicTilingScheme({
            ellipsoid: this.ellipsoid
          })
        });
        empCesium.terrainRemoveCallback();
        empCesium.scene.terrainProvider = empCesium.terrainProvider;
        console.error(" Terrain failed to load. Error: " + err + " Using default EllipsoidTerrainProvider.")
      });
    }
  }

